import React from 'react';
import './slider.styles.scss';

import { SwiperSlide } from 'swiper/react';

const SliderItem = ({ slide }) => {
  console.log(slide);
  return (
    <SwiperSlide>
      <div
        className="slider-image"
        style={{ backgroundImage: `url(${slide.imageURL})` }}
      ></div>
    </SwiperSlide>
  );
};

export default SliderItem;
